import CSSProps from "../../../data/constants/CSSProps";
import { Base } from "../../Base";
import React, {Suspense} from 'react';

class NavItem extends React.Component {
    
    render() { 
        const [t] = useTranslation(AppSettings.TranslationFilename);
        alert(this.props.classNameLi);
       return  <li className={this.props.classNameLi} onClick={()=>Base.prototype.SwitchPage(this.props.onClickPageID)}>
          <a href={this.props.path} className={this.props.classNameLink}>
            
            <span className={this.props.classNameSpan}>{t(this.props.spanText)}</span>
            <audio id={this.props.IconID + CSSProps.ID.Audio} src={this.props.clickSound}/>
          </a>
        </li>;
     };
}
 
export default NavItem;
